import React, {Component} from "react"

import PrikazProjekcija from "./PrikazProjekcija"
import FilterProjekcija from "./FilterProjekcija"

class Projekcije extends Component{

    constructor(){
        super()
        this.state = {
            projekcije:[],
            saleZaIzbor:[],
            tipoviZaIzbor:["2D", "3D", "4D"]
        }
    }

    componentDidMount(){
        const conf={
            headers: new Headers({'Authorization': 'Bearer ' + localStorage.getItem('jwt')},
                                  {'Access-Control-Allow-Methods':'GET'}),
          };

        fetch('http://localhost:8080/bioskop/projekcije',conf)
            .then(res => res.json())
            .then(response => {
                this.setState({
                    projekcije: response
            })
        })
    }

    render(){
        const prikaz=this.state.projekcije.map(p => <PrikazProjekcija key={p.id} projekcija={p} />)
        /*const prikazFilma=this.state.film !== "" && <Film state={this.props.state} cancel={this.cancel} editFilm={this.editFilm} deleteFilm={this.deleteFilm} film={this.state.film} />
        const editFilma=this.state.editFilm !== "" && <EditFilm handleSubmit={this.handleSubmit} 
                                                        cancel={this.cancel} handleChange={this.handleChange} 
                                                        film={this.state.editFilm} />*/

        return(
            <div id="idProjekcije">
                <table id="tableProjekcije" border="1">
                    <FilterProjekcija filter={this.filter} />
                    {prikaz}
                </table>
            </div>
        )
    }
}

export default Projekcije
